import Func from '../components/Func'

export default class Home extends React.Component {

  render() {


    return (
      <div>
          <Navbar />
          <h1 style={{paddingTop : '200px'}}>Home page ........</h1>
          
          <div className='container row'>
              <div className='col-9'>
                  <Func pth = "/" />
              </div>
              <div className='col-3'>

              </div>
          </div>
          
      </div>
    )
  }
}
